import React from "react";
import Heading from "./Heading.jsx";
import Table from "./Table";
import Parah from "./Parah";
import Message from "./Message";

function App() {
    return (
        <>
            <Heading />
            <Table />
            <Parah />
            <Heading />
            <h1> HELLO Sir! <Message /> </h1>
        </>
    );
}

export default App;
